参数示例：

```
{
	"entity_no":"index_person",
	"fields":"entity_det_id,entity_data_id,entity_no,field_code,val",
	"conditions":[
		{
			"cond_field":"field_code",
			"cond_operation":"like",
			"cond_value":"e"
		},
		{
			"cond_field":"field_code",
			"cond_operation":"=",
			"cond_value":"name"
		}
	],
	"is_page":"1",
	"page":"1",
	"page_size":"10"
}

```

1、若同一个field_code下，则数据自动覆盖
2、若对应的field_code在定义里面不存在，则报错
3、本接口一次新增一条记录

